import Grid from "@material-ui/core/Grid";
import Box from "@material-ui/core/Box";
import Typography from "@material-ui/core/Typography";
import React from "react";
import {InnerPreloader} from "../../../common/layout";
import Divider from "@material-ui/core/Divider";

function OrderFormSummarize({title = 'undefined', price = 0, isFetching, ...props}) {
    return (
        <Grid container>

            <Grid item xs={12}>
                <Box mt={2}>
                    <Typography component={'span'}>
                        Название: {isFetching ? <InnerPreloader size={12} sideMargin={0}/> : title}
                    </Typography>
                    <Divider />
                    <Typography component={'span'}>
                        Цена: {isFetching ? <InnerPreloader size={12} sideMargin={0}/> : `${price} $`}
                    </Typography>
                </Box>
            </Grid>

        </Grid>
    )
}

export default OrderFormSummarize
